import React, { useState } from "react";
import AddUser from "./components/Users/AddUser";
import UsersList from "./components/Users/UsersList";

function App() {
	const [usersList, serUsersList] = useState([]);

	return (
		<div>
			<AddUser /> <UsersList users={usersList} />
		</div>
	);
}

export default App;
